Chivalry: Medieval Warfare (2012) PC [HI2U]

============================================
Description:                               =
============================================

CHIVALRY: Medieval Warfare is a first-person medieval combat game that seeks to deliver the intensity of epic hollywood medieval block busters to the hands of a gamer. CHIVALRY hurls the player into a fictional yet realistic medieval world where the Agathian Knights are battling against the newly formed Mason Order for control of the lands of Agatha.

============================================
Language (ENG,RUS,DEU,ESN,FRA,ITA):        =
============================================

* Open game_folder/Engine/Config/BaseEngine.ini
* Find the line Language=RUS and change it to Language=INT (also DEU,ESN,FRA,ITA)

============================================
Instructions:                              =
============================================

* Install
* Play

